                //h[q.peek()]\u4E3A\u5DE6\u8FB9\u7B2C\u4E00\u4E2A\u6BD4cur\u9AD8\u7684\u77E9\u5F62\uFF0Ch[i]\u4E3A\u53F3\u8FB9\u7B2C\u4E00\u4E2A\u6BD4cur\u9AD8\u7684\u77E9\u5F62
                ans += (i - q.peek() - 1) * (Math.min(h[i], h[q.peek()]) - h[cur]);
